import React from 'react';
import { Container, Card, ListGroup } from 'react-bootstrap';

const AllCategories = () => {
  // Array of popular categories with URLs
  const popularCategories = [
    { name: 'Cleaning', url: '/services/cleaning' },
    { name: 'TV and Electronics', url: '/services/tv-electronics' },
    { name: 'Assembly', url: '/services/assembly' },
    { name: 'General Handyman', url: '/services/handyman' },
    { name: 'Plumbing', url: '/services/plumbing' },
    { name: 'Electrical', url: '/services/electrical' },
    { name: 'Painting', url: '/services/painting' }
  ];

  return (
    <Container className="my-4">
      <Card>
        <Card.Body>
          {/* Main Title */}
          <Card.Title as="h1" className="mb-4">
            All Categories
          </Card.Title>

          {/* Popular Section */}
          <Card.Subtitle as="h2" className="mb-3">
            Popular
          </Card.Subtitle>
          <ListGroup variant="flush">
            {popularCategories.map((category, index) => (
              <ListGroup.Item
                key={index}
                action
                href={category.url}
                className="text-decoration-none"
              >
                {category.name}
              </ListGroup.Item>
            ))}
          </ListGroup>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default AllCategories;
